        private static char [] UniTab1 = uniTab1.toCharArray();
        private static char [] UniTab2 = uniTab2.toCharArray();
        private static char [] UniTabS3 = uniTab3S.toCharArray();
        private static char [] UniTabS3_2 = uniTab3S2.toCharArray();
        private static char [] UniTabS3_3 = uniTab3S3.toCharArray();
        private static char [] UniTabS3_4 = uniTab3S4.toCharArray();
        private static char [] UniTab3 = uniTab3.toCharArray();
        private static char [] CNSTab1 = cnsTab1.toCharArray();
        private static char [] CNSTab2 = cnsTab2.toCharArray();
        private static char [] CNSTab3S = cnsTab3S.toCharArray();
        private static char [] CNSTab3S2 = cnsTab3S2.toCharArray();
        private static char [] CNSTab3S3 = cnsTab3S3.toCharArray();
        private static char [] CNSTab3S4 = cnsTab3S4.toCharArray();
        private static char [] CNSTab3 = cnsTab3.toCharArray();

        protected int getNative(char unicode) {
            int  i,
                 cns;   // 2 chars in CNS table make 1 CNS code

            if (unicode < UniTab2[0]) {
                if ((i = searchTab(unicode, UniTab1)) == -1)
                    return -1;
                cns = (CNSTab1[2*i] << 16) + CNSTab1[2*i+1];
                return cns;
            } else if (unicode < UniTab3[0]) {
                if ((i = searchTab(unicode, UniTab2)) == -1)
                    return -1;
                cns = (CNSTab2[2*i] << 16) + CNSTab2[2*i+1];
                return cns;
            } else {
                if ((i = searchTab(unicode, UniTab3)) == -1)
                    return -1;
                cns = (CNSTab3[2*i] << 16) + CNSTab3[2*i+1];
                return cns;
            }
        }

        protected int getSurrogateEnc(char c1, char c2) {
            int  i = -1;

            if ((i = searchTabSurr(c1, c2, UniTabS3)) != -1) {
                return ((CNSTab3S[i] << 16) + CNSTab3S[i+1]);
            }
            if ((i = searchTabSurr(c1, c2, UniTabS3_2)) != -1) {
                return ((CNSTab3S2[i] << 16) + CNSTab3S2[i+1]);
            }
            if ((i = searchTabSurr(c1, c2, UniTabS3_3)) != -1) {
                return ((CNSTab3S3[i] << 16) + CNSTab3S3[i+1]);
            }
            if ((i = searchTabSurr(c1, c2, UniTabS3_4)) != -1) {
                return ((CNSTab3S4[i] << 16) + CNSTab3S4[i+1]);
            }
            return -1;
        }

        protected int searchTab(char code, char [] table) {
            int     i = 0, l, h;

            for (l = 0, h = table.length - 1; l < h; ) {
                    if (table[l] == code) {
                            i = l;
                            break;
                    }
                    if (table[h] == code) {
                            i = h;
                            break;
                    }
                    i = (l + h) / 2;
                    if (table[i] == code)
                            break;
                    if (table[i] < code)
                            l = i + 1;
                    else        h = i - 1;
            }
            if (code == table[i]) {
                return i;
            } else {
                return -1;
            }
        }

        protected int searchTabSurr(char code1, char code2, char [] table) {
            int     i = 0, l, h;

            for (l = 0, h = table.length - 2; l < h; ) {
                    if (table[l] == code1 && table[l+1] == code2) {
                            i = l;
                            break;
                    }
                    if (table[h] == code1 && table[h+1] == code2) {
                            i = h;
                            break;
                    }
                    i = (l + h) / 2;
                    i = (i%2 != 0)? i - 1 : i;

                    if (table[i] == code1 && table[i+1] == code2)
                        break;

                    int sum = (int)(table[i+2] - 0xd800) * 0x400
                                + (int)(table[i+3] - 0xdc00) + 0x10000;
                    int sum2 = (int)(code1 - 0xd800) * 0x400
                                + (int)(code2 - 0xdc00) + 0x10000;
                    if (sum == sum2)
                        return (i + 2);

                    if (sum < sum2)
                        l = i + 2;
                    else
                        h = i - 2;
            }
            if (code1 == table[i] && code2 == table[i+1]) {
                return i;
            } else {
                return -1;
            }
        }


        private int unicodeToEUC(char unicode, char lowSurr, byte ebyte[]) {
            int cns = -1;

            if (lowSurr == '\uFFFD')
                cns = getNative(unicode);
            else
                cns = getSurrogateEnc(unicode, lowSurr);

            if ((cns >> 16) == 0x01) {  // Plane 1
                ebyte[0] = (byte) (((cns & 0xff00) >> 8) | MSB);
                ebyte[1] = (byte) ((cns & 0xff) | MSB);
                return 2;
            }

            byte cnsPlane = (byte)(cns >> 16);
            if (cnsPlane >= (byte)0x02) {       // Plane 2
                ebyte[0] = SS2;
                ebyte[1] = (byte) (cnsPlane | (byte)0xA0);
                ebyte[2] = (byte) (((cns & 0xff00) >> 8) | MSB);
                ebyte[3] = (byte) ((cns & 0xff) | MSB);
                return 4;
            }
        return -1;
        }

        private CoderResult encodeArrayLoop(CharBuffer src,
                                            ByteBuffer dst)
        {
            char[] sa = src.array();
            int sp = src.arrayOffset() + src.position();
            int sl = src.arrayOffset() + src.limit();
            assert (sp <= sl);
            sp = (sp <= sl ? sp : sl);
            byte[] da = dst.array();
            int dp = dst.arrayOffset() + dst.position();
            int dl = dst.arrayOffset() + dst.limit();
            assert (dp <= dl);
            dp = (dp <= dl ? dp : dl);

            int outputSize;
            byte [] outputByte = new byte[4];

            try {
                while (sp < sl) {
                    int inputSize = 1;

                    if (Surrogate.is(sa[sp])) {
                        char surr = sa[sp];
                        if (sgp.parse(surr, sa, sp, sl) < 0)
                            return sgp.error();
                        outputSize = unicodeToEUC(sa[sp], sa[sp+1], outputByte);
                        inputSize = 2;
                    } else if ( sa[sp] < 0x80) {  // ASCII
                        outputSize = 1;
                        outputByte[0] = (byte)sa[sp];
                    } else {
                        outputSize = unicodeToEUC(sa[sp], '\uFFFD', outputByte);
                    }
                    if (outputSize == -1)
                       return CoderResult.unmappableForLength(inputSize);

                    if ( dl - dp < outputSize)
                        return CoderResult.OVERFLOW;
                    for (int i = 0; i < outputSize; i++)
                        da[dp++] = outputByte[i];
                    sp  += inputSize;
                    }
                return CoderResult.UNDERFLOW;
            } finally {
                src.position(sp - src.arrayOffset());
                dst.position(dp - dst.arrayOffset());
            }
        }

        private CoderResult encodeBufferLoop(CharBuffer src,
                                             ByteBuffer dst)
        {
            int outputSize;
            int inputSize;
            byte [] outputByte = new byte[4];
            int mark = src.position();

            try {
                while (src.hasRemaining()) {
                    inputSize = 1;
                    char c = src.get();

                    if (Surrogate.is(c)) {
                        int surr;
                        if ((surr=sgp.parse(c, src)) < 0)
                            return sgp.error();
                        outputSize = unicodeToEUC(c,
                                                  Surrogate.low(surr),
                                                  outputByte);
                        inputSize = 2;
                    } else if ( c < 0x80) {   // ASCII
                        outputSize = 1;
                        outputByte[0] = (byte)c;
                    } else {
                        outputSize = unicodeToEUC(c, '\uFFFD',  outputByte);
                    }
                    if (outputSize == -1)
                       return CoderResult.unmappableForLength(inputSize);

                    if (dst.remaining() < outputSize)
                        return CoderResult.OVERFLOW;

                    for (int i = 0; i < outputSize; i++)
                        dst.put((byte)outputByte[i]);
                    mark += inputSize;
                }
                return CoderResult.UNDERFLOW;
            } finally {
                src.position(mark);
            }
        }

        protected CoderResult encodeLoop(CharBuffer src,
                                         ByteBuffer dst)
        {
            if (src.hasArray() && dst.hasArray())
                return encodeArrayLoop(src, dst);
            else
                return encodeBufferLoop(src, dst);
        }
